import { AppBar, IconButton, Toolbar, Tooltip } from "@mui/material";
import AccountCircleIcon from "@mui/icons-material/AccountCircle";
import AndroidIcon from "@mui/icons-material/Android";
import AddCircleOutlineIcon from '@mui/icons-material/AddCircleOutline';
import LogoutIcon from '@mui/icons-material/Logout';
import React from "react";
import { useStyles } from "./style";
import Login from "@mui/icons-material/Login";
import { useNavigate } from "react-router-dom";
import { connect } from "react-redux";
import { userLogout } from "../../redux/auth";

const Header = (props) => {
  const s = useStyles();
  const navigate = useNavigate()


  const onClickLogout = ()=>{
    props.userLogout(props.token)
    if(props.token === '')navigate('/login')
  }

  const tokenTrue = ()=>{
    return(
      <div>
    <Tooltip title="Profile">
      <IconButton onClick={()=>{navigate('/profile')}}>
          <AccountCircleIcon color="inherit" className={s.icon} />
      </IconButton>
    </Tooltip>
    <Tooltip title="LogOut" onClick={onClickLogout}>
      <IconButton>
          <LogoutIcon color="inherit" className={s.icon} />
      </IconButton>
    </Tooltip>
  </div>
    )
  }

  const tokenFalse = ()=>{
    return(
      <div>
    <Tooltip title="LogIn">
      <IconButton onClick={()=>{navigate('/login')}}>
        <Login color="inherit" className={s.icon} />
      </IconButton>
    </Tooltip>
    <Tooltip title="SignUp">
      <IconButton onClick={()=>{navigate('/signup')}}>
        <AddCircleOutlineIcon color="inherit" className={s.icon} />
      </IconButton>
    </Tooltip>
  </div>
    )
  }
  return (
    <AppBar className={s.appBar}>
      <Toolbar>
        <div className={s.bar}>
          <div className={s.logo}>
            <AndroidIcon />
          </div>
          <div className={s.menu}>
            {props.token == ''?tokenFalse():tokenTrue()}
          </div>
        </div>
      </Toolbar>
    </AppBar>
  );
};

const mapStateToProps = (state)=>{
  return{
    token: state.authReducer.token
  }
}

export default connect(mapStateToProps,{userLogout})(Header);
